import Header from "../../components/Header";
import { Box } from "@mui/material"

const Dashboard = () => {
  return <Box m="20px">
    <Header title="DASHBOARD" subtitle="Welcome to your dashboard!">
    </Header>
  </Box>;
};

export default Dashboard;
